require.config({"config": {
        "text":{"PayPal_Braintree/template/applepay/core-checkout.html":"<!-- ko if: deviceSupported -->\n<div class=\"payment-method\" data-bind=\"css: {'_active': (getCode() == isChecked())}\" id=\"payment-method-braintree-applepay\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"attr: {'id': getCode()}, value: getCode(), checked: isChecked, click: selectPaymentMethod, visible: isRadioButtonVisible()\"/>\n        <label data-bind=\"attr: {'for': getCode()}\" class=\"label\">\n            <!-- PayPal Logo -->\n            <img data-bind=\"attr: {src: getPaymentMarkSrc(), alt: $t('Apple Pay Mark')}\"\n                 class=\"payment-icon\"/>\n            <!-- PayPal Logo -->\n            <span text=\"getTitle()\"></span>\n        </label>\n    </div>\n    <div class=\"payment-method-content\">\n        <!-- ko foreach: getRegion('messages') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n\n        <div class=\"payment-method-billing-address\">\n            <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n\n        <div class=\"checkout-agreements-block\">\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <div class=\"actions-toolbar\">\n            <div class=\"primary\">\n                <div data-bind=\"html: getApplePayBtn('braintree-applepay-checkout-btn')\" id=\"braintree-applepay-checkout-btn\"></div>\n            </div>\n        </div>\n    </div>\n</div>\n<!--/ko-->"}
}});
